import React from 'react';

const Score = (props) => {
    return (
        <div>
            <h1>
                Check out your top scores
                <table>
                    <tr>
                        <th>Game Number</th>
                        <th>Score (Number of guesses left)</th>
                    </tr>
                    {this.props.Score.map((score, idx)=>{
                        <tr>
                            <td>Game:{idx}</td>
                            <td>{score}</td>
                        </tr>
                    })}
                </table>
            </h1>
        </div>
    )
}

export default Score
